import React from "react";
import Navbar from "./components/Navbar";
import { Switch, Route } from "react-router-dom";
import HomeScreen from "./components/HomeScreen";
import Login from "./components/Login";
import SignUp from "./components/SignUp";
import WannaJoin from "./components/WannaJoin";
import ContactUs from "./components/ContactUs";
import About from "./components/About"
import HowWorks from "./components/HowWorks";
import Why from "./components/Why";
import SignUpScreen from "./components/SignUpCompany";
import SignUpCompany from "./components/SignUpCompany";
import FindMovers from "./components/FindMovers";
import CustomerHeader from "./components/Customer/CustomerHeader";

const Home = () => {
  return (
    <>
      <Navbar />

    </>
  );
};



const Service = () => {
  return (
    <>
      <Navbar />
      <section className="hero-section">
        <p>Welcome to </p>
        <h1>Thapa Technical Service Page</h1>
      </section>
    </>
  );
};

const Contact = () => {
  return (
    <>
      <Navbar />
      <section className="hero-section">
        <p>Welcome to </p>
        <h1>Thapa Technical Contact Page</h1>
      </section>
    </>
  );
};

const App = () => {
  return (

    <Switch>

      <Route path="/customerH">
        <CustomerHeader />
      </Route>
<Route path="/signup">
        <SignUp />
      </Route>
      <Route path="/howorks">
        <HowWorks />
      </Route>
      <Route path="/whyMuvan">
        <Why />
      </Route>
      <Route path="/signupCompany">
        <SignUpCompany />
      </Route>
<Route path="/login">
        <Login />
        </Route>
<Route path="/join">
        <WannaJoin />
      </Route>
      <Route exact path="/">
        <Home />
      </Route>
      <Route exact path="/home">
        <HomeScreen />
      </Route>
      <Route path="/about">
        <About />
      </Route>   <Route path="/Contact">
        <ContactUs />
      </Route>



      <Route path="/contact">
        <Contact />
      </Route>
    </Switch>
  );
};

export default App;
